import React from 'react';
import {Box, Button, ButtonGroup, Flex, Heading, VStack} from "@chakra-ui/react";

const FoundQuiz = () => {
    return (
        <Box bg={'gray.100'} minH={'100vh'}>
            <Flex w={'100%'} direction={'column'}>
                <Box>
                    <VStack pt={10} spacing={4}>
                      {/*  QUIZ TITLE*/}
                      {/*  ACTION BUTTONS*/}
                      <VStack w={500} boxShadow={'md'} p={4} minW={'200px'} spacing={4}>
                          <Button size={'lg'} w={'100%'} colorScheme={'teal'}>Start</Button>
                          <Button  size={'lg'}  w={'100%'} colorScheme={'blue'}>Share</Button>
                          <Button  size={'lg'}  w={'100%'} colorScheme={'gray'}>Cancel</Button>
                      </VStack>
                    {/*    OPTIONS*/}
                        <Box  w={500} minW={200} bg={'white'}>
OPTIONs BOX
                        </Box>
                    </VStack>
                </Box>
            </Flex>
        </Box>
    );
};

export default FoundQuiz;
